import React from 'react';
import UserNavbar from '../components/UserNavbar';  // Import the new navbar
import '../styles/UserHomePage.css'

const UserHomePage = () => {
  return (
    <div>
      <UserNavbar />  {/* Insert the navbar here */}
      <div className="user-home-content">
        <h2>Welcome to BukSU Lost and Found System</h2>
        <p>Find your lost items or post a found item here.</p>
        {/* Add more content for the user home page */}
      </div>
    </div>
  );
};

export default UserHomePage;
